import React from "react";

const Project = ({ project }) => {
  return (
    <article>
      <span class="image">
        <img src="../img/pic01.jpg" alt="tile-background" />
      </span>
      <a href="../data/Sweet Eats Bakery/index.html" target="_blank">
        <h2>{project.title}</h2>
      </a>
      <div class="content">
        <p>{project.content}</p>
      </div>
    </article>
  );
};

export default Project;
